        function loadFileData(filename) {
        if (gk_isXlsx && gk_xlsxFileLookup[filename]) {
            try {
                var workbook = XLSX.read(gk_fileData[filename], { type: 'base64' });
                var firstSheetName = workbook.SheetNames[0];
                var worksheet = workbook.Sheets[firstSheetName];

                // Convert sheet to JSON to filter blank rows
                var jsonData = XLSX.utils.sheet_to_json(worksheet, { header: 1, blankrows: false, defval: '' });
                // Filter out blank rows (rows where all cells are empty, null, or undefined)
                var filteredData = jsonData.filter(row => row.some(filledCell));

                // Heuristic to find the header row by ignoring rows with fewer filled cells than the next row
                var headerRowIndex = filteredData.findIndex((row, index) =>
                  row.filter(filledCell).length >= filteredData[index + 1]?.filter(filledCell).length
                );
                // Fallback
                if (headerRowIndex === -1 || headerRowIndex > 25) {
                  headerRowIndex = 0;
                }

                // Convert filtered JSON back to CSV
                var csv = XLSX.utils.aoa_to_sheet(filteredData.slice(headerRowIndex)); // Create a new sheet from filtered array of arrays
                csv = XLSX.utils.sheet_to_csv(csv, { header: 1 });
                return csv;
            } catch (e) {
                console.error(e);

    <script src="https://unpkg.com/leaflet@1.9.4/dist/leaflet.js"></script>
    <script src="https://unpkg.com/papaparse@latest/papaparse.min.js"></script>
    <script src="https://cdnjs.cloudflare.com/ajax/libs/chrono-node/1.3.11/chrono.min.js"></script>
    <style>
        /* Fallback CSS if tailwind.css fails */
        body { background-color: #f3f4f6; font-family: sans-serif; }
        header { background-color: #16a34a; color: white; padding: 1rem; }
        header h1 { font-size: 1.875rem; font-weight: bold; text-align: center; }
        header p { text-align: center; }
        main { max-width: 1280px; margin: 1.5rem auto; padding: 1rem; }
        section { background-color: white; border-radius: 0.5rem; box-shadow: 0 4px 6px rgba(0,0,0,0.1); padding: 1.5rem; }
        section h2 { font-size: 1.5rem; font-weight: 600; margin-bottom: 1rem; }
        .text-center { text-align: center; }
        .hidden { display: none; }
        #map { height: 500px; width: 100%; }
        .custom-popup .leaflet-popup-content-wrapper { background-color: white; box-shadow: 0 3px 14px rgba(0,0,0,0.4); }
        .custom-popup .leaflet-popup-content { margin: 15px; }
    </style>
</head>
<body>
    <header>
        <h1>BirdBlog</h1>
        <p>A journal of birding lifeslist</p>
    </header>
    <main>
        <section>
            <h2>Your Bird Species Map</h2>
            <div id="loading" class="text-center">Loading data...</div>
            <div id="map" class="hidden"></div>
        </section>
    </main>
    <script>
        // Initialize Leaflet map
        let map;
        try {
            map = L.map('map').setView([0, 0], 2);
            L.tileLayer('https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png', {
                attribution: '© OpenStreetMap contributors'
            }).addTo(map);
            console.log('Leaflet map initialized');
        } catch (err) {
            console.error('Error initializing map:', err);
            document.getElementById('loading').textContent = 'Error initializing map';
        }

        // Object to store species counts and observations by country
        let speciesData = {};

        // Fallback CSV data (subset of Norway observations)
        const fallbackCSV = `
Submission ID,Common Name,Scientific Name,Taxonomic Order,Count,State/Province,County,Location ID,Location,Latitude,Longitude,Date,Time,Protocol,Duration (Min),All Obs Reported,Distance Traveled (km),Area Covered (ha),Number of Observers,Breeding Code,Observation Details,Checklist Comments,ML Catalog Numbers
S148110744,Bar-headed Goose,Anser indicus,255,1,NO-17,,L4536175,Tautra--Fugletårn og Måsdammen,63.5718996,10.6115339,2023-08-26,12:25 PM,eBird - Traveling Count,75,1,.65,,1,,Only one seen. Part of the flock of 5 that's been spotted here the last dew
S150544398,Ross's Goose,Anser rossii,261,2,NO-17,,L18117032,Alnesfjæra--Alnes fuglefredingsområde,63.7267738,11.2142534,2023-09-23,02:14 PM,eBird - Traveling Count,13,1,.09,,1,,White stout geese with black wingtips. Been reported in the same area over the last week,,609576764
S93529862,Graylag Goose,Anser anser,264,1000,NO-16,,L8999040,Hovsfjæra Fuglefredningsområde,63.7002737,9.6980964,2021-08-21,04:27 PM,eBird - Traveling Count,16,1,.13,,1
`;

        // Fetch GeoJSON with timeout and retry
        async function loadGeoJSON() {
            const timeout = (ms) => new Promise((_, reject) => setTimeout(() => reject(new Error('GeoJSON fetch timeout')), ms));
            for (let attempt = 1; attempt <= 3; attempt++) {
                try {
                    const response = await Promise.race([
                        fetch('https://raw.githubusercontent.com/nvkelso/natural-earth-vector/master/geojson/ne_110m_admin_0_countries.geojson'),
                        timeout(5000)
                    ]);
                    if (!response.ok) throw new Error(`GeoJSON fetch failed: ${response.status}`);
                    const data = await response.json();
                    console.log(`GeoJSON loaded successfully on attempt ${attempt}`);
                    return data;
                } catch (err) {
                    console.error(`GeoJSON fetch attempt ${attempt} failed:`, err);
                    if (attempt === 3) {
                        document.getElementById('loading').textContent = 'Error loading map data (GeoJSON)';
                        return null;
                    }
                }
            }
        }

        // Parse CSV data
        function parseCSVData(csv) {
            try {
                Papa.parse(csv, {
                    header: true,
                    skipEmptyLines: true,
                    transformHeader: header => header.trim().replace(/^"|"$/g, ''),
                    transform: (value, header) => {
                        let cleaned = value.trim().replace(/^"|"$/g, '');
                        if (header === 'Date') {
                            const parsedDate = chrono.parseDate(cleaned);
                            return parsedDate ? parsedDate.toISOString().split('T')[0] : cleaned;
                        }
                        if (header === 'All Obs Reported') {
                            return cleaned === '1' || cleaned.toLowerCase() === 'true' ? 1 : 0;
                        }
                        if (header === 'Count') {
                            return cleaned === 'X' ? 'Unknown' : (isNaN(cleaned) ? cleaned : parseInt(cleaned));
                        }
                        return cleaned;
                    },
                    complete: (results) => {
                        console.log('CSV parsed, rows:', results.data.length);
                        const cleanedData = processAndCleanData(results.data);
                        processBirdData(cleanedData);
                        console.log('Norway species count:', speciesData['NO'] ? speciesData['NO'].species.size : 0);
                        console.log('Norway observations:', speciesData['NO'] ? speciesData['NO'].observations : []);
                        document.getElementById('loading').classList.add('hidden');
                        document.getElementById('map').classList.remove('hidden');
                        initializeMap();
                    },
                    error: (err) => {
                        console.error('Error parsing CSV:', err);
                        document.getElementById('loading').textContent = 'Error loading CSV data';
                    }
                });
            } catch (err) {
                console.error('CSV parsing failed:', err);
                document.getElementById('loading').textContent = 'Error processing CSV data';
            }
        }

        // Clean and validate CSV data
        function processAndCleanData(data) {
            return data.filter(row => {
                if (!row['State/Province'] || !row['Common Name'] || row['All Obs Reported'] !== 1) {
                    return false;
                }
                if (!row['Date'] || isNaN(new Date(row['Date']).getTime())) {
                    return false;
                }
                return true;
            });
        }

        // Process bird data to group by country
        function processBirdData(data) {
            speciesData = {};
            data.forEach(row => {
                const countryCode = row['State/Province'].substring(0, 2);
                const commonName = row['Common Name'];
                const count = row['Count'];
                if (!countryCode || !commonName) return;
                if (!speciesData[countryCode]) {
                    speciesData[countryCode] = { species: new Set(), observations: [] };
                }
                speciesData[countryCode].species.add(commonName);
                speciesData[countryCode].observations.push({
                    commonName: commonName,
                    count: count,
                    date: row['Date'],
                    location: row['Location'],
                    details: row['Observation Details'] || 'No details provided'
                });
            });
        }

        // Function to style countries based on species count
        function getColor(count) {
            return count > 200 ? '#800026' :
                   count > 100 ? '#BD0026' :
                   count > 50  ? '#E31A1C' :
                   count > 20  ? '#FC4E2A' :
                   count > 10  ? '#FD8D3C' :
                   count > 0   ? '#FEB24C' : '#FFFFFF';
        }

        // Style for GeoJSON layer
        function style(feature) {
            const regionCode = feature.properties.ISO_A2;
            const count = speciesData[regionCode] ? speciesData[regionCode].species.size : 0;
            return {
                fillColor: getColor(count),
                weight: 2,
                opacity: 1,
                color: 'white',
                fillOpacity: 0.7
            };
        }

        // Highlight feature on hover
        function highlightFeature(e) {
            const layer = e.target;
            layer.setStyle({
                weight: 5,
                color: '#666',
                fillOpacity: 0.7
            });
            const regionCode = layer.feature.properties.ISO_A2;
            const count = speciesData[regionCode] ? speciesData[regionCode].species.size : 0;
            layer.bindTooltip(`<b>${layer.feature.properties.NAME}</b><br>Species: ${count}`).openTooltip();
        }

        // Reset style on mouseout
        function resetHighlight(e) {
            geojson.resetStyle(e.target);
        }

        // Show pop-up on click with only bird names
        function onFeatureClick(e) {
            const country = e.target.feature.properties.NAME;
            const regionCode = e.target.feature.properties.ISO_A2;
            const species = speciesData[regionCode] ? Array.from(speciesData[regionCode].species) : [];
            let content = `<h3 style="font-size: 1.25rem; font-weight: bold; margin-bottom: 1rem;">Birds in ${country}</h3>`;
            if (species.length === 0) {
                content += '<p>No species found.</p>';
            } else {
                content += '<div style="max-height: 200px; overflow-y: auto;"><ul style="list-style-type: disc; padding-left: 20px; margin-bottom: 1rem;">';
                species.forEach(name => {
                    content += `<li>${name}</li>`;
                });
                content += '</ul></div>';
            }
            content += `<a href="gallery.html?country=${encodeURIComponent(regionCode)}" style="color: #16a34a; text-decoration: underline;">View Gallery for this Country</a><br>`;
            content += `<button onclick="this.getPopup().remove()" style="margin-top: 1rem; background-color: #16a34a; color: white; padding: 0.5rem 1rem; border-radius: 0.25rem; border: none; cursor: pointer;">Close</button>`;

            try {
                L.popup({
                    maxWidth: 400,
                    maxHeight: 300,
                    autoPan: true,
                    closeButton: false,
                    className: 'custom-popup'
                })
                    .setLatLng(e.target.getBounds().getCenter())
                    .setContent(content)
                    .openOn(map);
            } catch (err) {
                console.error('Error opening popup:', err);
                document.getElementById('loading').textContent = 'Error displaying species list';
            }
        }

        // Add interaction to each feature
        function onEachFeature(feature, layer) {
            layer.on({
                mouseover: highlightFeature,
                mouseout: resetHighlight,
                click: onFeatureClick
            });
        }

        // Load and render GeoJSON
        let geojson;
        async function initializeMap() {
            const geojsonData = await loadGeoJSON();
            if (geojsonData) {
                try {
                    geojson = L.geoJson(geojsonData, {
                        style: style,
                        onEachFeature: onEachFeature
                    }).addTo(map);
                    console.log('Map initialized with GeoJSON');
                } catch (err) {
                    console.error('Error rendering GeoJSON:', err);
                    document.getElementById('loading').textContent = 'Error rendering map';
                }
            }
        }

        // Load CSV data
        try {
            let csvData = loadFileData('MyEBirdData.csv');
            if (!csvData) {
                console.warn('CSV file not found, using fallback data');
                csvData = fallbackCSV;
                document.getElementById('loading').textContent = 'Using fallback data (CSV not found)';
            }
            parseCSVData(csvData);
        } catch (err) {
            console.error('Error loading CSV:', err);
            console.warn('Falling back to sample data');
            parseCSVData(fallbackCSV);
        }
    </script>
</body>
</html>
